import { useState } from 'react'

export const useFetchGIfs = () => { //est es un custom hook

    const [state, setState] = useState(
        {
            data: [],
            loading: true
        }
    )

    setTimeout(() => {
        {
            data: [1,2,3,4,5]
            loading: false
        }
    }, 2000);
    return state;
}
